<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>
    <link
      href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha3/dist/css/bootstrap.min.css"
      rel="stylesheet"
      integrity="sha384-KK94CHFLLe+nY2dmCWGMq91rCGa5gtU4mk92HdvYe+M/SXH301p5ILy+dN9+nJOZ"
      crossorigin="anonymous"
    />
    <link rel="stylesheet" href="./a.css" />
  </head>
  <body>
    <nav class="navbar bg-body-tertiary">
      <div class="container-fluid">
        <a class="navbar-brand"><b class="modelfirst">V</b>ijaykumar</a>
        <form class="d-flex" role="search">
          <input
            class="form-control me-2"
            type="search"
            placeholder="Search"
            aria-label="Search"
          />
          <button class="btn btn-outline-success" type="submit">Search</button>
        </form>
      </div>
    </nav>
    <div class="button_main">
        
      <button class="btn btn-primary p-4">Enter</button>
      <button type="button" class="btn btn-outline-primary">Primary</button>
      <button class="btn btn-secondary px-5">Enter</button>
      <button type="button" class="btn btn-outline-secondary">Secondary</button>
      <button class="btn btn-danger py-4">Enter</button>
      <button type="button" class="btn btn-outline-success">Success</button>
      <button class="btn btn-success m-2">Enter</button>
      <button type="button" class="btn btn-outline-danger">Danger</button>
      <button class="btn btn-warning my-5">Enter</button>
      <button type="button" class="btn btn-outline-warning">Warning</button>
      <button class="btn btn-info my-6">Enter</button>
      <button type="button" class="btn btn-outline-info">Info</button>
      <button class="btn btn-light">Enter</button>
      <button type="button" class="btn btn-outline-light">Light</button>
      <button class="btn btn-dark">Enter</button>
      <button type="button" class="btn btn-outline-dark">Dark</button>
    </div>
    <script
      src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0-alpha3/dist/js/bootstrap.bundle.min.js"
      integrity="sha384-ENjdO4Dr2bkBIFxQpeoTz1HIcje39Wm4jDKdf19U8gI4ddQ3GYNS7NTKfAdVQSZe"
      crossorigin="anonymous"
    ></script>
  </body>
</html>
